import { createBrowserRouter } from 'react-router-dom';
import React from 'react';
import Contact from './sites/contact';
import App from './App';

const routes = createBrowserRouter([
  {
    path: '/',
    element: <App />,
  }, {
    path: '/contact',
    element: <Contact />,
  },
]);
export default routes;
